tail_schedule";s:79:"/upload/resize_cache/main/904/320_436_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";s:20:"slider_photo_preview";s:75:"/upload/resize_cache/main/904/438_264_1/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:25:"webp_slider_photo_preview";s:79:"/upload/resize_cache/main/904/438_264_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";s:17:"slider_popup_full";s:52:"/upload/main/904/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:22:"webp_slider_popup_full";s:80:"/upload/resize_cache/main/904/1024_787_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";}s:4:"name";s:46:"Корнеев Игорь Алексеевич";s:8:"position";s:161:"Главный врач, врач уролог-андролог высшей категории, доктор медицинских наук, профессор";s:2:"id";s:2:"13";}s:8:"question";a:7:{s:5:"title";s:12:"Вопрос";s:4:"name";s:12:"Андрей";s:5:"image";s:0:"";s:8:"position";s:0:"";s:4:"text";s:1415:"У жены были симптомы молочницы, пропила курс таблеток. У меня же редко проявляются симптомы жжения в уретре. Условие такое: сначала мастурбация, потом мочеиспускание. Жжение держится минут 15 и проходит. Причем, если был обычный половой контакт, потом мочеиспускание, то ничего не проявляется. Ровно как и только при мочеиспускании. Бывает и так, что ничего не бывает после мастурбации. В общем симптом есть, я с ним уже год точно, но проявляется он как то редко и поэтому всё никак не дойду до врача. Кстати у жены молочница также с рецидивами. Подозреваю у нас порочный круг. Она тушит симптомы таблетками, а я никакого лечения не прохожу и рано или поздно снова её заражаю. В общем хочу уточнить верность своих догадок и спросить совета какие анализы сдать перед походом к врачу.";s:5:"files";s:0:"";s:4:"date";s:14:"24 мая 2019";}s:6:"answer";a:8:{s:5:"title";s:10:"Ответ";s:4:"name";s:46:"Корнеев Игорь Алексеевич";s:5:"image";a:18:{s:8:"ORIGINAL";s:52:"/upload/main/904/042A6510-kopiya-_1_-_1_-_1_-_1_.png";s:13:"webp_ORIGINAL";s:75:"/upload/resize_cache/main/904/0_0_1_95/042A6510-kopiya-_1_-_1_-_1_-_1_.webp";s:9:"100_100_P";s:75:"/upload/resize_cache